return ['x-generator'=>'GlotPress/4.0.1','translation-revision-date'=>'2025-03-19 05:52:12+0000','plural-forms'=>'nplurals=2; plural=n != 1;','project-id-version'=>'Themes - Twenty Twenty-Four','language'=>'gu','messages'=>['Twenty Twenty-Four is designed to be flexible, versatile and applicable to any website. Its collection of templates and patterns tailor to different needs, such as presenting a business, blogging and writing or showcasing work. A multitude of possibilities open up with just a few adjustments to color and typography. Twenty Twenty-Four comes with style variations and full page designs to help speed up the site building process, is fully compatible with the site editor, and takes advantage of new design tools introduced in WordPress 6.4.'=>'Twenty Twenty-Four એ લવચીક, બહુમુખી અને કોઈપણ વેબસાઈટને લાગુ પડે તે રીતે ડિઝાઇન કરવામાં આવી છે. તેના નમૂનાઓ અને પેટર્નનો સંગ્રહ વિવિધ જરૂરિયાતોને અનુરૂપ છે, જેમ કે વ્યવસાયને પ્રસ્તુત કરવા, બ્લોગિંગ અને લેખન અથવા કાર્યનું પ્રદર્શન. રંગ અને ટાઇપોગ્રાફીમાં માત્ર થોડા ગોઠવણો સાથે ઘણી બધી શક્યતાઓ ખુલે છે. Twenty Twenty-Four એ સાઇટ બનાવવાની પ્રક્રિયાને ઝડપી બનાવવા માટે શૈલીની વિવિધતાઓ અને સંપૂર્ણ પૃષ્ઠ ડિઝાઇન સાથે આવે છે, તે સાઇટ સંપાદક સાથે સંપૂર્ણ રીતે સુસંગત છે, અને વર્ડપ્રેસ 6.4 માં રજૂ કરાયેલા નવા ડિઝાઇન સાધનોનો લાભ લે છે.','Twenty Twenty-Four'=>'ટવેન્ટી ટવેન્ટી-ફોર','Pattern descriptionA centered text statement with a large amount of padding on all sides.'=>'એક કેન્દ્રિત ટેક્સ્ટ નિવેદન જેમાં દરેક બાજુ પર વિશાળ પેડિંગ છે.','Pattern titlePosts heading'=>'પોસ્ટ્સનું શીર્ષક','Pattern descriptionA cover image section that covers the entire width.'=>'અ કવર ઇમેજ સેક્શન ધેટ કવરસ ધ એન્ટાયર વિડ્થ.','Pattern descriptionA footer section with a colophon and 4 columns.'=>'અ ફૂટર સેક્શન વિથ અ કોલોફોન અને ૪ કોલમ્સ.','Pattern descriptionA footer section with a colophon and 3 columns.'=>'અ ફૂટર સેક્શન વિથ અ કોલોફોન અને ૩ કોલમ્સ.','Pattern descriptionA footer section with a centered logo, navigation, and WordPress credits.'