tern descriptionA list of posts with featured images only, 3 columns.'=>'ફીચર્ડ ઇમેજેસ સાથે પોસ્ટ્સની યાદી, 3 કૉલમ.','Pattern descriptionA centered testimonial section with an avatar, name, and job title.'=>'અવતાર, નામ અને નોકરીનું શીર્ષક સાથેનો કેન્દ્રિત પ્રશંસાપત્ર વિભાગ.','Pattern descriptionA team section, with a heading, a paragraph, and 4 columns for team members.'=>'ટીમ વિભાગ, જેમાં શીર્ષક, પરિચ્છેદ અને 4 કૉલમમાં ટીમના સભ્યો છે.','Pattern descriptionA text section, then a two-column section with text in one column and an image in the other.'=>'ટેક્સ્ટ વિભાગ, પછી એક બે-કોલમ વિભાગ જેમાં એક કોલમમાં ટેક્સ્ટ અને બીજું કોલમમાં છબી.','Pattern descriptionA full portfolio page with a section for project description, project details, a full screen image, and a gallery section with two images.'=>'પ્રોજેક્ટ વર્ણન, પ્રોજેક્ટ વિગતો, સંપૂર્ણ સ્ક્રીન છબી અને બે છબીઓ સાથે ગેલેરી વિભાગ માટેના વિભાગ સાથેનું સંપૂર્ણ પોર્ટફોલિયો પેજ.','Pattern descriptionA block with a newsletter subscription CTA for a landing page.'=>'લેન્ડિંગ પૃષ્ઠ માટે ન્યૂઝલેટર સબ્સ્ક્રિપ્શન CTA સાથેનો બ્લોક.','Pattern descriptionA portfolio home page with a description and a 4-column post section with only feature images.'=>'વર્ણન સાથેનું પોર્ટફોલિયો હોમ પેજ અને માત્ર ફીચર ઈમેજીસ સાથે 4-કૉલમ પોસ્ટ વિભાગ.','Pattern descriptionA business home page with a hero section, a text section, a services section, a team section, a clients section, a FAQ section, and a CTA section.'=>'હીરો સેક્શન, ટેક્સ્ટ સેક્શન, સર્વિસ સેક્શન, ટીમ સેક્શન, ક્લાયન્ટ સેક્શન, FAQ સેક્શન અને CTA સેક્શન સાથેનું બિઝનેસ હોમ પેજ.','Pattern descriptionA blogging home page with a hero section, a text section, a blog section, and a CTA section.'=>'હીરો વિભાગ, ટેક્સ્ટ વિભાગ, બ્લોગ વિભાગ અને CTA વિભાગ સાથેનું બ્લોગિંગ હોમ પેજ.','Pattern descriptionA business about page with a hero section, a text section, a services section, a team section, a clients section, a FAQ section, and a CTA section.'=>'હીરો સેક્શન, ટેક્સ્ટ સેક્શન, સર્વિસ સેક્શન, ટ